import PublicRoutes from "./public-routes.component"
import React from "react"
import { useAuth } from "@modules/auth"

const AppRoutes = () => {
	const auth = useAuth()
	return auth ? <ProtectedRoutes /> : <PublicRoutes />
}

export default AppRoutes
